import { StatusBar } from "expo-status-bar";
import React from "react";
import {
  StyleSheet,
  Text,
  TouchableOpacity,
  Image,
  View,
  SafeAreaView,
  Button,
  Alert,
} from "react-native";

export default function App() {
  const handlePress = () => console.log("I pressed it");
  console.log(require("./assets/icon.png"));
  return (
    <SafeAreaView style={styles.container}>
      <Text>USC Visitors App</Text>
      <Text onPress={handlePress}>David, Sarah, Morice</Text>
      <TouchableOpacity
        onPress={() => console.log("hello")}
        style={styles.homeImage}
      >
        <Image
          source={require("./assets/undrawMap.png")}
          style={{
            height: 200,
            width: 200,
          }}
        />
      </TouchableOpacity>

      <TouchableOpacity
        style={styles.button}
        onPress={() => alert("hello teamates")}
      >
        <Text style={styles.text}> Touch Here </Text>
      </TouchableOpacity>

      <StatusBar style="auto" />
    </SafeAreaView>
  );
}

const styles = StyleSheet.create({
  container: {
    flex: 1,
    backgroundColor: "#fff",
    alignItems: "center",
    justifyContent: "center",
  },
  homeImage: {
    elevation: 4,
    shadowOffset: { width: 5, height: 5 },
    shadowColor: "grey",
    shadowOpacity: 0.3,
    shadowRadius: 10,
    margin: "1rem",
    paddingTop: "1rem",
    paddingBottom: "1rem",
    paddingLeft: "1rem",
    paddingRight: "1rem",
    borderRadius: 50,
  },

  button: {
    backgroundColor: "maroon",
    padding: "1rem",
    borderRadius: 50,
  },

  buttonText: {
    color: "white",
  },
});
